void Display_numb0(u16 x,u16 y,const uint16_t * font)
{
  uint8_t row_count,byte_count,bit_count;
  //160,10,
  for(row_count = 0;row_count < 160;row_count++)
  {
    printf("\r\n");
    for(byte_count = 0;byte_count < 10;byte_count++)
    {
      for(bit_count=0;bit_count <8;bit_count++)
      {
        
        if((*(font+row_count*10+byte_count)) & (0x80>>bit_count))
       {
         LCD_Fast_DrawPoint(x+byte_count*8+bit_count,y+row_count,BLACK);  //background  
       }
       else
         LCD_Fast_DrawPoint(x+byte_count*8+bit_count,y+row_count,WHITE); //
      }
    }
    
  }
  
};


void Draw_FullCircle1(uint16_t Xpos,uint16_t Ypos,uint16_t Radius,u16 color)
{
  uint16_t x,y,r=Radius;
  for(y=Ypos-r;y<=Ypos+r+1;y++)
  {
    for(x=Xpos-r;x<=Xpos+r+1;x++)
    {
      if((((x-Xpos)*(x-Xpos)+(y-Ypos)*(y-Ypos))<=r*r))
      {
        LCD_SetCursor(x,y);      			      	// 
        LCD_WriteRAM_Prepare();     		      	//GRAM	 
        LCD->LCD_RAM=color;//
       }
     }
    }
}

 
